import { Link } from "react-router-dom";
import './nav.css'


const Navbar = () => {
  return (
/*
<Link to="/">Movies</Link>

<Link to="/">Home</Link>

<Link to="../pages/create" style={{ 
              color: 'white', 
              backgroundColor: '#f1356d',
              borderRadius: '8px' 
            }}>New Movie</Link>
*/

            <div>
            <nav>
              <h1>AMHF</h1>
              <span className="search-span">
                <input className="search" type="text" placeholder="Search..." />
              </span>
              
            </nav>
            </div>



  );
}
 
export default Navbar;
